      key: "checkHistoryFile",
      value: function checkHistoryFile() {
        var fail;
        // console.log("GameGUI.checkHistoryFile")
        fail = function fail() {
          alert(JSON.stringify(arguments));
        };
        window.requestFileSystem(LocalFileSystem.PERSISTENT, 0, function (fileSystem) {
          fileSystem.root.getFile(Const.TEMP_HISTORY, {
            create: true,
            exclusive: false
          }, function (fileEntry) {
            fileEntry.file(function (file) {
              var reader;
              reader = new FileReader();
              reader.onloadend = function (evt) {
                // console.log 'fileEntry is file?' + fileEntry.isFile.toString()
                // console.log 'fileEntry name?' + fileEntry.name
                // console.log 'fileEntry path?' + fileEntry.fullPath
                // alert 'text from file:' + reader.result
                setTimeout(function () {
                  var event;
                  event = new $.Event('fileHist');
                  return $(document).trigger(event, reader.result);
                }, 500);
              };
              reader.onerror = function () {
                alert('error: ' + JSON.stringify(reader.error));
              };
              reader.readAsText(file);
            }, fail);
          }, fail);
        }, fail);
      }
